/** @format */

import React from 'react';

import Button from '../button/button.component';

import './cartDropdown.scss';

const CartDropDown = () => {
	return (
		<div className='cart_dropdown'>
			<div>
				<Button>Check Out</Button>
			</div>
		</div>
	);
};

export default CartDropDown;
